Bingkin Ngugi (Dean Tyson) is a storyteller and celebrated Goori (Aboriginal) artist living in South East Queensland. Bingkin''s tribal geneology is of Meerooni clan of the Gurang nation, Ngugi and Geonpul clans of Quandamooka nation with paternal ties to Gunngari nation.

Bingkin always honours his ancestors and family through his art process and works both in career and within community. As an artist, Binkin Ngugi shares knowledge and Aboriginal way of thinking, always was and always will be Goori Land.

Join us for live art with Bingkin Ngugi at the main stage of Queen Street Mall between 12 noon and 1pm. 

This Gathering event is produced by Cre8tiveNations.  Gathering showcases Aboriginal and Torres Strait Islander performances in the Queen Street Mall. Unique to Brisbane, it is the only Indigenous performance in Australia that is featured weekly in the heart of a major capital city.', 'Brisbane City Council', 'Aboriginal and Torres Strait Islander,Creative,Culture,Featured,Free,Music,Performing arts', 'Gathering', 'Aboriginal and Torres Strait Islander', 'Free', 'https://www.trumba.com/i/DgD9z9THgFc%2ATWchsaMiVMrO.jpg', 'Suitable for all ages.', 'No bookings required.', TRUE, NULL, NULL, NULL, NULL, 'Queen Street Mall, Brisbane City', 'Queen Street Mall, Queen Street, Brisbane City', 'General Council venue', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '179415823');

