Bush Kindy is for children aged 3-5 years, alongside their parents and carers. This session is presented in partnership with Brisbane City Council Libraries and First 5 Forever. First 5 Forever is an initiative of the Queensland Government, co-ordinated by the State Library of Queensland and delivered in partnership with local government.

Bush Kindy sessions can go for up to 45 minutes and themes vary each week.

On the day of the event: Arrive 10 minutes before the start of the event to check in at the centre. All children must be accompanied and directly supervised by an adult. Wear a wide-brimmed hat, sun-smart clothing, sunscreen, fully enclosed walking shoes and insect repellent. Bring drinking water and a snack or picnic lunch as there are no food outlets on site. It is recommended to bring a spare change of clothes as sessions may include messy play.Note: Events are subject to weather and environmental conditions and may be cancelled on the day.', 'Brisbane City Council', 'Family events,Free,Green', NULL, NULL, 'Free', 'https://www.trumba.com/i/DgCynkijd7E9TN3dNRwsZ5kx.jpeg', '3-5 years', 'Bookings required via <a href="https://www.eventbrite.com.au/e/bush-kindy-library-stories-and-rhymes-tickets-1096887583289" target="_blank">Eventbrite</a>.

All adults and children (including infants) must have a ticket for this event. Maximum of 5 people per booking. A ratio of 1 adult per 4 children is required. If you cannot attend this event, cancel your booking via Eventbrite.

As our program is popular, your tickets will be forfeited if you do not arrive in time for the session to make way for available attendees.', TRUE, NULL, NULL, NULL, NULL, 'Boondall Wetlands Environment Centre', 'Boondall Wetlands Environment Centre, 31 Paperbark Drive (entry via Stanworth Rd), Boondall', 'Park', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '179702626');
