On Thursday, 20 February, from 11:30am to 2pm, Post Office Square transforms into a vibrant hub of free live music, offering the perfect midday escape to refresh and recharge.

Relax to the acoustic sounds of Ben Clements bringing a soothing rhythm to your workday.

Gather your colleagues, meet up with friends, or embrace some solo downtime on the lawns of Post Office Square. Settle under the shade of a tree or umbrella, or kick back on one of the picnic rugs or chairs provided.

Complete the experience with a delicious lunch—grab a meal from nearby eateries or bring your own for a perfect alfresco moment.

City Beats is brought to you by City Parklands and proudly supported by 215 Adelaide Street. While you’re here, explore the fantastic food court retailers including GYG, Grazegrind, Phat Elephant, Uncle Li’s, Sings Vietnamese and Pando Cafe and make your lunch break unforgettable.

