Talk to a Planner is available all year round, with additional sessions held regularly across the city for your convenience.

During these free sessions you can speak face-to-face with a planning specialist, giving you the opportunity to ask any questions you may have about how City Plan relates to your property.

Council also has a team of dedicated officers who can answer simple questions about your development application over the phone during business hours (9am-4pm, Monday-Friday). To speak to an officer please phone Council on 07 3403 8888 and ask to speak with a Planning Information Officer.', 'Brisbane City Council', 'Free,Workshops', NULL, 'Workshops', 'Free', 'https://www.trumba.com/i/DgB908LJM3yZcmAKPMGRTJXS.jpg', 'Open', 'Sessions are by appointment only. Book your 15 minute appointment via <a href="https://www.eventbrite.com.au/e/talk-to-a-planner-carindale-library-20-february-2025-tickets-1216022258309" target="_blank">Eventbrite</a>.&nbsp;', TRUE, NULL, NULL, NULL, NULL, 'Carindale Library', 'Carindale Library, Westfield Carindale, 1151 Creek Road (near Millennium Boulevard), Carindale', 'Library', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '180079060');
 
An Australian virtuoso now based in Germany, Stephanie has earned both a Master’s and a Konzertexamen degree from the prestigious University of Music Franz Liszt Weimar. She has won numerous awards in prestigious competitions, including first prize at the Hannabach Guitar Competition, Uppsala International Guitar Festival Competition, and Fine Music Network Young “Virtuoso of the Year” Competition.
 
Stephanie also has a number of devoted followers from across the globe. Across all her social media channels, she has over 200,000 followers, with her YouTube channel being one of the largest in the classical guitar world, accumulating over 140,000 subscribers and more than 17 million views.
 
Stephanie continues to perform and give masterclasses around the world in multiple tours and festivals. She has released four albums, her latest titled “Open Sky” (2020), featuring music from South America.
 
Passionate about sharing her music with others, Stephanie is recognised as an innovative and deeply musical artist.', 'Brisbane City Council', 'Music', NULL, NULL, '$33-66', 'https://www.trumba.com/i/DgDRBZrglJijib9I3LwIi967.jpg', 'Suitable for all ages', 'Bookings required via the <a href="https://concertsaustralia.com/steph/#book" target="_blank">Concerts Australia website</a>.&nbsp;', TRUE, 'Teens,Young adults,Adults (30+),Seniors', NULL, NULL, NULL, 'Sandgate Town Hall, Sandgate', 'Sandgate Town Hall, corner of Cliff and Seymour Streets, Sandgate', 'Community Hall,General Council venue', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '179353223');

Whatever your skill level and motivation, joining your local Habitat Brisbane group is a great way to connect to nature and be active and healthy, all while meeting new people, developing new skills and making a difference to your local environment. With 160 groups across the city there’s bound to be one near you!

