These informal sessions are facilitated by environment centre staff and are suitable for beginners and those who have already started journaling. After a simple introductory session, staff will lead a short, gentle guided walk to practice some nature journaling. After the activity ends, participants are welcome to continue journaling in the natural beauty of the reserve. Please bring your own basic A5 sketch/art pad and a re-usable cup to enjoy tea and coffee on arrival.

What is nature journaling? Nature journaling is the practice of recording your personal interactions with nature using sketches, writing, paintings, poetry, lists, numbers, graphs, cartoons and more. This easy, relaxing practice encourages mindfulness, hones observation skills, and cultivates a sense of wonder and curiosity. Close observation of the natural world can be a wonderful form of meditative expression, and provides an opportunity for stillness, reflection, and mindful connection with nature. 

Requirements:  Please bring your own basic A5 sketch/art pad and a re-usable cup. Please bring your own outdoor chair to use if required, as there may be limited seating for some sessions. Wear sun-safe clothing, sunscreen, fully enclosed walking shoes, and bring insect repellent. Bring drinking water and a snack as there are no food outlets on site.Meeting point: Picnic shelter near the basketball court. If the carpark is full, park in nearby Raven Street and walk 5 minutes through the reserve to the centre.

