INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, maximumparticipantcapacity, activitytype, requirements, venue, venueaddress, venuetype, meetingpoint, status, libraryeventtypes, waterwayaccessfacilities, waterwayaccessinformation, eventtype, suburb, ward, image, locationifvenueunavailable, externaleventid) VALUES ('Nature Journaling', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d179863454', 'Boondall Wetlands Environment Centre', '2025-02-18T10:00:00+10:00', '2025-02-18T12:00:00+10:00', 'Tuesday, 18 February 2025, 10am - 12pm', 'Nature journaling is the practice of recording your interactions with nature using sketches, writing, paintings, poetry, species lists, numbers, graphs, cartoons and more. Environment centre staff will guide you through some fun, simple exercises at this introductory session. Nature journaling is an easy, relaxing practice and encourages mindfulness, hones observation skills, and cultivates a sense of wonder. Close observation and recording of the natural world can be a wonderful form of meditative expression, and provides an opportunity for stillness, reflection, and mindful connection with nature.
