INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, maximumparticipantcapacity, activitytype, requirements, venue, venueaddress, venuetype, meetingpoint, status, libraryeventtypes, waterwayaccessfacilities, waterwayaccessinformation, eventtype, suburb, ward, image, locationifvenueunavailable, externaleventid) VALUES ('Bazil Grumble playtime', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d174599993', 'Frew Park, Milton', '2025-02-19T10:00:00+10:00', '2025-02-19T12:00:00+10:00', 'Wednesday, 19 February 2025, 10am - 12pm', 'Bookings essential. Children will have a ball in this series of interactive learn and grow sessions! Using balls, hoops, parachutes, tunnels, jumping sacks, puppets, storybooks, costumes and music, children will explore all the different ways their growing bodies can move. These sessions are a wonderful opportunity for children and their caregivers to experience the fun of social interaction through play.', 'Active and healthy events', 'Fitness & well-being,Free', NULL, NULL, 'Free', 'https://www.trumba.com/i/DgCXkkuXpiBB53Ajtt6ZScIv.jpg', '3-5 years old', 'Bookings essential. To book visit <a href="http://bazilgrumble.com/whats-on/" target="_blank">Bazil Grumble</a>. For more information phone 0411 246 487.', NULL, 'Preschool kids', '.', 'Kids activities', NULL, 'Frew Park, Milton', 'Frew Park, 315 Milton Road, Milton', 'Park,Pop-up library location', 'Meet under the shaded trees surrounding the oval in the middle of the park.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '174599993');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, maximumparticipantcapacity, activitytype, requirements, venue, venueaddress, venuetype, meetingpoint, status, libraryeventtypes, waterwayaccessfacilities, waterwayaccessinformation, eventtype, suburb, ward, image, locationifvenueunavailable, externaleventid) VALUES ('A rainforest ecosystem in the city - Special walk - City Botanic Gardens', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d179698374', 'City Botanic Gardens - Information Kiosk, Brisbane City', '2025-02-19T10:00:00+10:00', '2025-02-19T11:30:00+10:00', 'Wednesday, 19 February 2025, 10 - 11:30am', 'Over the nearly 20 hectares of the Brisbane City Botanic Gardens, there are about 2500 trees primarily from tropical and subtropical climes from around the world. In this special haven within a thriving modern city, a unique rainforest ecosystem has been developed to showcase the wonders of such a fragile environment that is gradually disappearing in our world. This walk will inspire and uplift as you experience a tropical landscape within an urban setting.
