INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, maximumparticipantcapacity, activitytype, requirements, venue, venueaddress, venuetype, meetingpoint, status, libraryeventtypes, waterwayaccessfacilities, waterwayaccessinformation, eventtype, suburb, ward, image, locationifvenueunavailable, externaleventid) VALUES ('Zumba Gold®', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d173997178', 'Sunnybank Community Centre, Sunnybank', '2025-02-19T17:30:00+10:00', '2025-02-19T18:30:00+10:00', 'Wednesday, 19 February 2025, 5:30 - 6:30pm', 'Enjoy a fun, simple and low-impact workout in a welcoming and supportive atmosphere. Shake it at your own pace to zesty Latin tunes, Indian infused rhythms plus a variety of other wonderful music. This class will help you improve your balance, range of motion and coordination.', 'Active and healthy events', 'Fitness & well-being,Free', NULL, NULL, 'Free', 'https://www.trumba.com/i/DgAcQeGJV46us9frpv7WFCbP.jpg', 'All ages', '<p>No bookings required. For more information&nbsp;visit <a href="http://boogiecamp.com.au" target="_blank">BoogieCamp</a> or phone Olga on 0415 818 983.</p>', NULL, NULL, '.', 'Fitness and strength', NULL, 'Sunnybank Community Centre, Sunnybank', 'Sunnybank Community Centre, 65 Gager Street, Sunnybank', 'Community Hall,General Council venue', 'If the gates are locked, please wait at GATE 2 (at the back of the car park) for the instructor, otherwise, meet inside the hall.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sunnybank Community Hall, Sunnybank', '173997178');
