INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, maximumparticipantcapacity, activitytype, requirements, venue, venueaddress, venuetype, meetingpoint, status, libraryeventtypes, waterwayaccessfacilities, waterwayaccessinformation, eventtype, suburb, ward, image, locationifvenueunavailable, externaleventid) VALUES ('Stephanie Jones', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d179353222', 'Sandgate Town Hall, Sandgate', '2025-02-19T19:30:00+10:00', '2025-02-19T20:45:00+10:00', 'Wednesday, 19 February 2025, 7:30 - 8:45pm', 'Stephanie Jones’ childhood resonated with the sound of music from a very young age. She played many instruments, beginning with the piano and progressing to the violin, viola, saxophone, and flute. However, it was the guitar, with its captivating range of sounds and remarkable versatility, that captured her imagination and became her first love—a love that would shape her future and establish her as one of the world’s leading classical guitarists.
