INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, maximumparticipantcapacity, activitytype, requirements, venue, venueaddress, venuetype, meetingpoint, status, libraryeventtypes, waterwayaccessfacilities, waterwayaccessinformation, eventtype, suburb, ward, image, locationifvenueunavailable, externaleventid) VALUES ('Essays in Light - An Exhibition of Fine Art Photography by The Fine Monochrome Print Group', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d180103064', 'Richard Randall Art Studio, Toowong', '2025-02-20T09:00:00+10:00', '2025-02-20T16:00:00+10:00', 'Thursday, 20 February 2025, 9am - 4pm', 'The “Essays in Light” exhibition showcases the artistry of ten photographers from the Fine Monochrome Print Group, each presenting a thematic series of fine art prints that dive into subjects as varied as architecture, landscapes, figure studies, flora, portraits, and still life.  Each portfolio reveals a distinct creative perspective, capturing the depth and beauty of photography.
