INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, maximumparticipantcapacity, activitytype, requirements, venue, venueaddress, venuetype, meetingpoint, status, libraryeventtypes, waterwayaccessfacilities, waterwayaccessinformation, eventtype, suburb, ward, image, locationifvenueunavailable, externaleventid) VALUES ('Pickleball', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d174731485', 'Roy Emerson Tennis Centre, Milton', '2025-02-21T09:00:00+10:00', '2025-02-21T10:00:00+10:00', 'Friday, 21 February 2025, 9 - 10am', 'Bookings essential. Pickleball is the addictive game with the funny name. It''s a paddle sport you can learn in minutes and play for a lifetime. It brings together elements of tennis, badminton, and table tennis to create a sport that’s fun for all ages and skill levels. It''s easy to play and low impact.
