INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, maximumparticipantcapacity, activitytype, requirements, venue, venueaddress, venuetype, meetingpoint, status, libraryeventtypes, waterwayaccessfacilities, waterwayaccessinformation, eventtype, suburb, ward, image, locationifvenueunavailable, externaleventid) VALUES ('Guided walk of the Billai Dhagun circuit', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d180079552', 'Boondall Wetlands', '2025-02-22T09:30:00+10:00', '2025-02-22T11:00:00+10:00', 'Saturday, 22 February 2025, 9:30 - 11am', 'Join experienced Volunteer Guides in a guided walk through the stunning Boondall Wetlands Reserve. Learn about the unique plants and animals of the wetlands on this gentle, easy, all abilities 2km walk. Participants can visit the Bird Hide, observe distinct changes in vegetation, and discover why Boondall Wetlands is an internationally important conservation area.
