INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, maximumparticipantcapacity, activitytype, requirements, venue, venueaddress, venuetype, meetingpoint, status, libraryeventtypes, waterwayaccessfacilities, waterwayaccessinformation, eventtype, suburb, ward, image, locationifvenueunavailable, externaleventid) VALUES ('Vegetarian cooking made easy', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d174188454', 'Brighton Wellness Hub, Brighton', '2025-02-22T10:00:00+10:00', '2025-02-22T12:00:00+10:00', 'Saturday, 22 February 2025, 10am - 12pm', 'Bookings essential. If meat doesn''t agree with you and you need to ditch it from your diet, or maybe you just want to reduce the amount you consume to see what effect it has, then this is the workshop for you! Join Nutritionist Penny Benjamin as she shows you how easy and delicious it is to eat a plant-based diet while ensuring you meet all your nutritional intake needs.', 'Active and healthy events', 'Fitness & well-being', NULL, NULL, '$6', 'https://www.trumba.com/i/DgAM4LlyhfDMQSx1jiG0xa3t.jpg', 'All ages', 'Bookings essential. To book visit <a href="http://pennybenjamin.com.au/product-category/cooking-classes/" target="_blank">Penny Benjamin</a>.&nbsp; For more information phone Penny on 0401 638 667.<p>&nbsp;</p>', NULL, NULL, '.', 'Food and nutrition', 'Enclosed shoes.', 'Brighton Wellness Hub, Brighton', 'Brighton Wellness Hub, 449 Hornibrook Highway, Brighton', 'Non-Council venue', 'In the Brighton Wellness Hub reception.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '174188454');
