INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, maximumparticipantcapacity, activitytype, requirements, venue, venueaddress, venuetype, meetingpoint, status, libraryeventtypes, waterwayaccessfacilities, waterwayaccessinformation, eventtype, suburb, ward, image, locationifvenueunavailable, externaleventid) VALUES ('SIX60', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d178869431', 'Riverstage, Brisbane City', '2025-02-22T17:00:00+10:00', '2025-02-22T22:00:00+10:00', 'Saturday, 22 February 2025, 5 - 10pm', 'After their regional Grassroots Tour earlier this year became the fastest sell-out tour in SIX60’s history, New Zealand’s biggest band is back, answering the call from fans who missed out. The SIX60 Grassroots City Edition Tour presented by Niche Productions and The Morningshift gives fans another chance to experience the band up close in a raw, intimate setting – this time outside at picturesque city venues that elevate the experience to a whole new level and allow a celebration of late-summer in Australia.
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, maximumparticipantcapacity, activitytype, requirements, venue, venueaddress, venuetype, meetingpoint, status, libraryeventtypes, waterwayaccessfacilities, waterwayaccessinformation, eventtype, suburb, ward, image, locationifvenueunavailable, externaleventid) VALUES ('Stand-up paddle boarding', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d174729731', 'Bayside Park, Manly', '2025-02-23T06:00:00+10:00', '2025-02-23T07:00:00+10:00', 'Sunday, 23 February 2025, 6 - 7am', 'Bookings essential. Learn the basics of stand up paddle boarding. This lesson includes safety instruction, paddle techniques and activity tips. All equipment is provided and no experience is necessary.', 'Active and healthy events', 'Fitness & well-being', NULL, NULL, '$6', 'https://www.trumba.com/i/DgBl9m-6h%2A7gf0o3o-hylcxD.jpg', '10 years and over.', 'Bookings essential. To book visit <a href="http://scsurfschools.com.au/book-now/details/218732/active-healthy-brisbane-program-sup/" target="_blank">Sunshine Coast Surf Schools</a>.&nbsp;For more information phone Leighton on 0412 563 191.', NULL, 'Kids,Teens,Young adults,Adults (30+)', '.', 'Adventure,Water activities', 'Swimwear and a towel.  Sunshine Coast Surf Schools will provide a sunsafe top to wear during the activity.', 'Bayside Park, Manly', 'Bayside Park, 450 Esplanade, Manly', 'Park', 'In the park beside the amenities block.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '174729731');
