INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, maximumparticipantcapacity, activitytype, requirements, venue, venueaddress, venuetype, meetingpoint, status, libraryeventtypes, waterwayaccessfacilities, waterwayaccessinformation, eventtype, suburb, ward, image, locationifvenueunavailable, externaleventid) VALUES ('English conversation group', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d179778703', 'Brisbane Square Library', '2025-02-23T13:30:00+10:00', '2025-02-23T14:30:00+10:00', 'Sunday, 23 February 2025, 1:30 - 2:30pm', 'This friendly and informal group meets in the library every Tuesday, Thursday, Friday and Sunday. Come along to make new friends and improve your English. Learners of all levels are welcome.', 'Library events', 'Free', NULL, NULL, 'Free', 'https://www.trumba.com/i/DgAzjFg6bgY1q4UVLn-4dyK6.jpg', 'Young adults, Adults (30+), Seniors', 'Not required.', NULL, 'Young adults,Adults (30+),Seniors', NULL, NULL, NULL, 'Brisbane Square Library', 'Brisbane Square Library, 266 George Street, Brisbane City', 'Library', NULL, NULL, 'English conversation groups', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '179778703');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, maximumparticipantcapacity, activitytype, requirements, venue, venueaddress, venuetype, meetingpoint, status, libraryeventtypes, waterwayaccessfacilities, waterwayaccessinformation, eventtype, suburb, ward, image, locationifvenueunavailable, externaleventid) VALUES ('Journey to the Stars', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d180786530', 'Sir Thomas Brisbane Planetarium, Mt Coot-tha', '2025-02-23T14:00:00+10:00', '2025-02-23T14:45:00+10:00', 'Sunday, 23 February 2025, 2 - 2:45pm', 'This dazzling space show launches visitors through space and time to experience the life and death of the stars in our night sky, including our own nurturing Sun. Tour familiar stellar formations, explore new celestial mysteries, and discover the fascinating, unfolding story that connects us all to the stars. Those who come along for the journey may never see the night sky in the same way again. Narrated by Whoopi Goldberg, Session concludes with a virtual tour of the Brisbane night sky.
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, maximumparticipantcapacity, activitytype, requirements, venue, venueaddress, venuetype, meetingpoint, status, libraryeventtypes, waterwayaccessfacilities, waterwayaccessinformation, eventtype, suburb, ward, image, locationifvenueunavailable, externaleventid) VALUES ('Passport to the Universe', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d180786605', 'Sir Thomas Brisbane Planetarium, Mt Coot-tha', '2025-02-23T15:00:00+10:00', '2025-02-23T15:45:00+10:00', 'Sunday, 23 February 2025, 3 - 3:45pm', 'Get your passport for a thrilling journey through the Solar System, beneath the rings of Saturn, into the heart of the Orion Nebula, out of the Milky Way Galaxy and to the edge of the observable universe, returning home via a black hole. Narrated by Tom Hanks.
