INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, maximumparticipantcapacity, activitytype, requirements, venue, venueaddress, venuetype, meetingpoint, status, libraryeventtypes, waterwayaccessfacilities, waterwayaccessinformation, eventtype, suburb, ward, image, locationifvenueunavailable, externaleventid) VALUES ('Writing Mondays', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d179487359', 'Wynnum Library', '2025-02-24T09:00:00+10:00', '2025-02-24T14:00:00+10:00', 'Monday, 24 February 2025, 9am - 2pm', 'Writing Mondays is a free, volunteer-led program for writers at all levels. Come and finish your story, while connecting with other writers in your community. Inspired by Queensland Writers Centre''s successful Writing Friday program, these sessions follow the Pomodoro Technique of 25-minute blocks and 5-minute breaks. Every third ''Pomodoro'', we take a 15-minute break to relax and recharge. The idea behind the method is to train the mind into working effectively to reach smaller targets, improving the overall writing time and productivity.', 'Library events', 'Free', NULL, NULL, 'Free', 'https://www.trumba.com/i/DgCs8NtyIRpmr8xIRE%2AJglYm.jpg', 'Seniors, Adults (30+), Young adults', 'Not required.', NULL, 'Young adults,Adults (30+),Seniors', NULL, NULL, NULL, 'Wynnum Library', 'Wynnum Library, 145 Florence Street, Wynnum', 'Library', NULL, NULL, 'Literary events,Writing', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '179487359');
