INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, maximumparticipantcapacity, activitytype, requirements, venue, venueaddress, venuetype, meetingpoint, status, libraryeventtypes, waterwayaccessfacilities, waterwayaccessinformation, eventtype, suburb, ward, image, locationifvenueunavailable, externaleventid) VALUES ('Music beat kids groups', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d174642334', 'Wynnum Wading Pool Park, Wynnum', '2025-02-24T09:00:00+10:00', '2025-02-24T09:30:00+10:00', 'Monday, 24 February 2025, 9 - 9:30am', 'Come and enjoy the great outdoors with your little ones while you move and make music together. You will share a special time with other parents, while helping your little ones learn and grow through musical play and movement. Take home tips for how to keep grooving and creating musical moments at home provided.', 'Active and healthy events', 'Fitness & well-being,Free', NULL, NULL, 'Free', 'https://www.trumba.com/i/DgC8i3dfQMV6ipVMHsqQFmoR.jpeg', '2-5 years old', 'No bookings required. For more information phone Vicky from Music Beat Kids on 1800 752 968.', NULL, 'Preschool kids', '.', 'Kids activities', NULL, 'Wynnum Wading Pool Park, Wynnum', 'Wynnum Wading Pool Park, Wynnum Esplanade, Wynnum', 'Park,Pop-up library location', 'Meet under the tree to the left of the carpark, that is on the left side of the whale features looking out to the bay.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '174642334');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, maximumparticipantcapacity, activitytype, requirements, venue, venueaddress, venuetype, meetingpoint, status, libraryeventtypes, waterwayaccessfacilities, waterwayaccessinformation, eventtype, suburb, ward, image, locationifvenueunavailable, externaleventid) VALUES ('Community Immunisation Clinic - Mitchelton', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d178941757', 'Mitchelton Library', '2025-02-24T09:00:00+10:00', '2025-02-24T11:00:00+10:00', 'Monday, 24 February 2025, 9 - 11am', 'Brisbane City Council provides free vaccinations to eligible residents (aged from 6 weeks and above) through our community immunisation clinics. Immunisation helps protect people against diseases such as influenza, measles, whooping cough, polio and tetanus.
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, maximumparticipantcapacity, activitytype, requirements, venue, venueaddress, venuetype, meetingpoint, status, libraryeventtypes, waterwayaccessfacilities, waterwayaccessinformation, eventtype, suburb, ward, image, locationifvenueunavailable, externaleventid) VALUES ('Essays in Light - An Exhibition of Fine Art Photography by The Fine Monochrome Print Group', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d180103068', 'Richard Randall Art Studio, Toowong', '2025-02-24T09:00:00+10:00', '2025-02-24T16:00:00+10:00', 'Monday, 24 February 2025, 9am - 4pm', 'The “Essays in Light” exhibition showcases the artistry of ten photographers from the Fine Monochrome Print Group, each presenting a thematic series of fine art prints that dive into subjects as varied as architecture, landscapes, figure studies, flora, portraits, and still life.  Each portfolio reveals a distinct creative perspective, capturing the depth and beauty of photography.
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, maximumparticipantcapacity, activitytype, requirements, venue, venueaddress, venuetype, meetingpoint, status, libraryeventtypes, waterwayaccessfacilities, waterwayaccessinformation, eventtype, suburb, ward, image, locationifvenueunavailable, externaleventid) VALUES ('Chair yoga dance', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d173998862', 'Wynnum Municipal Hall, Wynnum', '2025-02-24T09:00:00+10:00', '2025-02-24T10:00:00+10:00', 'Monday, 24 February 2025, 9 - 10am', 'Gentle and fun movement to keep active and healthy. Feel better, reduce pain, increase mobility and become happier! Using the chair as a prop we combine traditional yoga postures with dance and music. Classes aim to strengthen and stretch the body and lift your spirits. 
