INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, maximumparticipantcapacity, activitytype, requirements, venue, venueaddress, venuetype, meetingpoint, status, libraryeventtypes, waterwayaccessfacilities, waterwayaccessinformation, eventtype, suburb, ward, image, locationifvenueunavailable, externaleventid) VALUES ('Community Immunisation Clinic - Wooloowin', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d178941832', 'The Community Place, Kalinga', '2025-02-25T09:00:00+10:00', '2025-02-25T11:00:00+10:00', 'Tuesday, 25 February 2025, 9 - 11am', 'Brisbane City Council provides free vaccinations to eligible residents (aged from 6 weeks and above) through our community immunisation clinics. Immunisation helps protect people against diseases such as influenza, measles, whooping cough, polio and tetanus. Providing a free immunisation service is another way Council is helping deliver our Brisbane Vision.
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, maximumparticipantcapacity, activitytype, requirements, venue, venueaddress, venuetype, meetingpoint, status, libraryeventtypes, waterwayaccessfacilities, waterwayaccessinformation, eventtype, suburb, ward, image, locationifvenueunavailable, externaleventid) VALUES ('Essays in Light - An Exhibition of Fine Art Photography by The Fine Monochrome Print Group', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d180103069', 'Richard Randall Art Studio, Toowong', '2025-02-25T09:00:00+10:00', '2025-02-25T16:00:00+10:00', 'Tuesday, 25 February 2025, 9am - 4pm', 'The “Essays in Light” exhibition showcases the artistry of ten photographers from the Fine Monochrome Print Group, each presenting a thematic series of fine art prints that dive into subjects as varied as architecture, landscapes, figure studies, flora, portraits, and still life.  Each portfolio reveals a distinct creative perspective, capturing the depth and beauty of photography.
