INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, maximumparticipantcapacity, activitytype, requirements, venue, venueaddress, venuetype, meetingpoint, status, libraryeventtypes, waterwayaccessfacilities, waterwayaccessinformation, eventtype, suburb, ward, image, locationifvenueunavailable, externaleventid) VALUES ('Essays in Light - An Exhibition of Fine Art Photography by The Fine Monochrome Print Group', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d180103071', 'Richard Randall Art Studio, Toowong', '2025-02-27T09:00:00+10:00', '2025-02-27T16:00:00+10:00', 'Thursday, 27 February 2025, 9am - 4pm', 'The “Essays in Light” exhibition showcases the artistry of ten photographers from the Fine Monochrome Print Group, each presenting a thematic series of fine art prints that dive into subjects as varied as architecture, landscapes, figure studies, flora, portraits, and still life.  Each portfolio reveals a distinct creative perspective, capturing the depth and beauty of photography.
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, maximumparticipantcapacity, activitytype, requirements, venue, venueaddress, venuetype, meetingpoint, status, libraryeventtypes, waterwayaccessfacilities, waterwayaccessinformation, eventtype, suburb, ward, image, locationifvenueunavailable, externaleventid) VALUES ('Pickleball', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d174731475', 'Morningside Tennis Centre, Morningside', '2025-02-27T09:00:00+10:00', '2025-02-27T10:00:00+10:00', 'Thursday, 27 February 2025, 9 - 10am', 'Bookings essential. Pickleball is the addictive game with the funny name. It''s a paddle sport you can learn in minutes and play for a lifetime. It brings together elements of tennis, badminton, and table tennis to create a sport that’s fun for all ages and skill levels. It''s easy to play and low impact.
