INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, maximumparticipantcapacity, activitytype, requirements, venue, venueaddress, venuetype, meetingpoint, status, libraryeventtypes, waterwayaccessfacilities, waterwayaccessinformation, eventtype, suburb, ward, image, locationifvenueunavailable, externaleventid) VALUES ('Music beat kids groups', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d174642112', 'Brisbane Botanic Gardens Mt Coot-tha', '2025-02-27T09:30:00+10:00', '2025-02-27T10:00:00+10:00', 'Thursday, 27 February 2025, 9:30 - 10am', 'Come and enjoy the great outdoors with your little ones while you move and make music together. You will share a special time with other parents, while helping your little ones learn and grow through musical play and movement. Take home tips for how to keep grooving and creating musical moments at home provided.', 'Active and healthy events', 'Fitness & well-being,Free', NULL, NULL, 'Free', 'https://www.trumba.com/i/DgC8i3dfQMV6ipVMHsqQFmoR.jpeg', '2-5 years old', 'No bookings required. For more information phone Vicky from Music Beat Kids on 1800 752 968.', NULL, 'Preschool kids', '.', 'Kids activities', NULL, 'Brisbane Botanic Gardens Mt Coot-tha', 'Brisbane Botanic Gardens Mt Coot-tha, 152 Mt Coot-tha Road, Toowong', 'Park', 'Meet at the Amphitheatre', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '174642112');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, maximumparticipantcapacity, activitytype, requirements, venue, venueaddress, venuetype, meetingpoint, status, libraryeventtypes, waterwayaccessfacilities, waterwayaccessinformation, eventtype, suburb, ward, image, locationifvenueunavailable, externaleventid) VALUES ('Yoga', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d174332801', 'Balmoral Park, Morningside', '2025-02-27T09:30:00+10:00', '2025-02-27T10:30:00+10:00', 'Thursday, 27 February 2025, 9:30 - 10:30am', 'Focus on a range of movements to relax the mind and body. Stretching, breathing, strength and balance exercises are included by incorporating standing poses and mat work into the session.', 'Active and healthy events', 'Fitness & well-being,Free', NULL, NULL, 'Free', 'https://www.trumba.com/i/DgCcY02CtTmqwxedoGT-GRvp.jpeg', 'All ages', 'No bookings required. For more information email <a href="mailto:info@yogaandwellnessforall.com.au" target="_blank">Yoga and Wellness For All</a>&nbsp;or call Ellen on 0402 901 358.', NULL, NULL, '.', 'Mind and body', 'Exercise mat and insect repellent.', 'Balmoral Park, Morningside', 'Balmoral Park, 481 Wynnum Road, Morningside', 'Park', 'On the grass in front of the Scout Hall. Past the council depot, at the back of the cemetery, not far from the Meals on Wheels and C&K Creche on Balmoral Hill.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '174332801');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, maximumparticipantcapacity, activitytype, requirements, venue, venueaddress, venuetype, meetingpoint, status, libraryeventtypes, waterwayaccessfacilities, waterwayaccessinformation, eventtype, suburb, ward, image, locationifvenueunavailable, externaleventid) VALUES ('Zumba Gold®', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d173997340', 'Drevesen Park, Manly', '2025-02-27T09:30:00+10:00', '2025-02-27T10:30:00+10:00', 'Thursday, 27 February 2025, 9:30 - 10:30am', 'Enjoy a fun, simple and low-impact workout in a welcoming and supportive atmosphere. Shake it at your own pace to zesty Latin tunes, Indian infused rhythms plus a variety of other wonderful music. This class will help you improve your balance, range of motion and coordination.', 'Active and healthy events', 'Fitness & well-being,Free', NULL, NULL, 'Free', 'https://www.trumba.com/i/DgAcQeGJV46us9frpv7WFCbP.jpg', 'All ages', '<p>No bookings required. For more information, visit <a href="http://boogiecamp.com.au" target="_blank">BoogieCamp</a> or contact Olga on 0415 818 983.</p>', NULL, NULL, '.', 'Fitness and strength', NULL, 'Drevesen Park, Manly', 'Drevesen Park, 83 Lower Esplanade, Manly', 'Park', 'Under the trees behind the waterfront rotunda.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '173997340');
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, maximumparticipantcapacity, activitytype, requirements, venue, venueaddress, venuetype, meetingpoint, status, libraryeventtypes, waterwayaccessfacilities, waterwayaccessinformation, eventtype, suburb, ward, image, locationifvenueunavailable, externaleventid) VALUES ('Tai Chi Qigong', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d174573638', 'Keong Park, Stafford', '2025-02-27T09:30:00+10:00', '2025-02-27T10:30:00+10:00', 'Thursday, 27 February 2025, 9:30 - 10:30am', 'This dynamic activity is invigorating and will help you feel relaxed, refreshed and calm. Rejuvenate your body and learn to create a tranquil mind. Join any week.
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, maximumparticipantcapacity, activitytype, requirements, venue, venueaddress, venuetype, meetingpoint, status, libraryeventtypes, waterwayaccessfacilities, waterwayaccessinformation, eventtype, suburb, ward, image, locationifvenueunavailable, externaleventid) VALUES ('Yoga', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d174170563', 'Biami Yumba Park, Fig Tree Pocket', '2025-02-27T09:30:00+10:00', '2025-02-27T10:30:00+10:00', 'Thursday, 27 February 2025, 9:30 - 10:30am', 'Focus on a range of movements for active, healthy ageing and to relax the mind and body. Stretching, breathing, strength and balance exercises are included by incorporating standing poses and mat work into the session.
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, maximumparticipantcapacity, activitytype, requirements, venue, venueaddress, venuetype, meetingpoint, status, libraryeventtypes, waterwayaccessfacilities, waterwayaccessinformation, eventtype, suburb, ward, image, locationifvenueunavailable, externaleventid) VALUES ('The Art of Tea', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d180517281', 'Botanic Gardens Auditorium, Brisbane Botanic Gardens Mt Coot-tha', '2025-02-27T10:00:00+10:00', '2025-02-27T13:30:00+10:00', 'Thursday, 27 February 2025, 10am - 1:30pm', 'Making tea is an ancient art – long practiced in both China and Japan. If you are interested in the history and tradition of tea and want to experience more than an afternoon ‘cuppa’, then this is the workshop for you. Delight in the subtle delicacy of a green or yellow tea, imbibe the robust taste of a rich red, or experience the delight of a fermented pu-er tea.
INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, maximumparticipantcapacity, activitytype, requirements, venue, venueaddress, venuetype, meetingpoint, status, libraryeventtypes, waterwayaccessfacilities, waterwayaccessinformation, eventtype, suburb, ward, image, locationifvenueunavailable, externaleventid) VALUES ('Free guided tour - City Botanic Gardens', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d178957398', 'City Botanic Gardens - Information Kiosk, Brisbane City', '2025-02-27T10:00:00+10:00', '2025-02-27T11:00:00+10:00', 'Thursday, 27 February 2025, 10 - 11am', 'Take a free volunteer guided walk to learn about the plants and features at the City Botanic Gardens. Our volunteer guides all have a love for Brisbane’s Botanic Gardens and a desire to share their passion and knowledge with visitors.
