INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, maximumparticipantcapacity, activitytype, requirements, venue, venueaddress, venuetype, meetingpoint, status, libraryeventtypes, waterwayaccessfacilities, waterwayaccessinformation, eventtype, suburb, ward, image, locationifvenueunavailable, externaleventid) VALUES ('Aqua interval training', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d174272001', 'Jindalee Pool, Jindalee', '2025-02-28T10:30:00+10:00', '2025-02-28T11:30:00+10:00', 'Friday, 28 February 2025, 10:30 - 11:30am', 'A highly effective form of cardiovascular training, which involves brief bursts of high-intensity work followed by a recovery period. This allows you to workout at a higher intensity, with less impact on the body and with the added benefit of resistance that the water provides. Suitable for all fitness levels. Everyone works at their own pace.', 'Active and healthy events', 'Fitness & well-being', NULL, NULL, 'Pool entry fee', 'https://www.trumba.com/i/DgBCW7KMa%2AjzyS%2A4zG13uglH.jpg', NULL, 'Bookings not required. For more information phone Donna on 0404 044 287.', NULL, NULL, '.', 'Water activities', 'Swimwear and a towel.', 'Jindalee Pool, Jindalee', 'Jindalee Pool, 11 Yallambee Road, Jindalee', 'Swimming pool', 'Reception.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '174272001');
