INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, maximumparticipantcapacity, activitytype, requirements, venue, venueaddress, venuetype, meetingpoint, status, libraryeventtypes, waterwayaccessfacilities, waterwayaccessinformation, eventtype, suburb, ward, image, locationifvenueunavailable, externaleventid) VALUES ('Tycho Goes to Mars', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d180786390', 'Sir Thomas Brisbane Planetarium, Mt Coot-tha', '2025-03-01T11:00:00+10:00', '2025-03-01T11:35:00+10:00', 'Saturday, 1 March 2025, 11 - 11:35am', 'Our favourite cheeky dog is blasting off to discover the red planet, Mars. Tycho is in search of water to fly his steam-powered space kennel back home. But how will he find water on Mars, when it looks so cold, dusty and dry? Produced by Melbourne Planetarium at Scienceworks, Museums Victoria.
