INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, maximumparticipantcapacity, activitytype, requirements, venue, venueaddress, venuetype, meetingpoint, status, libraryeventtypes, waterwayaccessfacilities, waterwayaccessinformation, eventtype, suburb, ward, image, locationifvenueunavailable, externaleventid) VALUES ('Kayaking for Clean Up Australia Day', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d174701482', 'Sinbad Street Boat Ramp', '2025-03-02T09:00:00+10:00', '2025-03-02T12:00:00+10:00', 'Sunday, 2 March 2025, 9am - 12pm', 'Bookings essential. Join staff from Boondall Wetlands Environment Centre and Paddle Queensland on a kayak adventure to help clean up our creeks and preserve coastal biodiversity. All equipment and instruction is provided, perfect for beginners or those with experience. Paddling is a low impact activity, but due to the nature of paddlesports a reasonable level of fitness and health is required to participate.', 'Active and healthy events', 'Fitness & well-being', NULL, NULL, '$6', 'https://www.trumba.com/i/DgBzdS6bCYEbE5Phd4vHnaiL.jpeg', '10 years and over. Each person under 16 years must be accompanied by an adult.', 'Bookings essential. To book visit <a href="http://paddleqld.asn.au/event-calendar/" target="_blank">Paddle Queensland</a>. For more information phone Paddle Queensland on 0414 960 728.', NULL, 'Kids,Teens,Young adults,Adults (30+)', '.', 'Adventure,Water activities', 'Clothing and enclosed shoes that can get wet (not Crocs or any footwear that can fall off), towel and change of clothes.', 'Sinbad Street Boat Ramp', 'Sinbad Street Boat Ramp, Sinbad Street, Shorncliffe', 'Park', 'By the Shorncliffe public boat ramp off Sinbad Street.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '174701482');
